<html><head><meta content="text/html; charset=UTF-8" http-equiv="content-type"><meta name="viewport" content="width=device-width, initial-scale=1">
    <style>
      :root {
        /* Responsive type scale */
        --base-size: clamp(18px, 1.1vw + 14px, 22px);
        --h1-size: clamp(32px, 3vw + 18px, 44px);
        --h2-size: clamp(26px, 2.2vw + 16px, 34px);
        --h3-size: clamp(22px, 1.8vw + 14px, 28px);

        /* Comfortable reading width */
        --content-width: 72ch;

        /* Spacing scale */
        --space-s: 0.75rem;
        --space-m: 1.25rem;
        --space-l: 2rem;
      }

      html {
        font-size: 100%;
        -webkit-text-size-adjust: 100%;
      }

      body {
        margin: 0;
        padding: clamp(16px, 4vw, 40px);
        max-width: var(--content-width);
        margin-inline: auto;
        box-sizing: border-box;

        /* Mixed Arabic + English typography */
        font-family:
          "Crimson Pro",
          "Lora",
          "Amiri",
          "Tajawal",
          system-ui,
          -apple-system,
          Arial,
          sans-serif;

        font-size: var(--base-size);
        line-height: 1.8;
        letter-spacing: 0.01em;
        text-rendering: optimizeLegibility;
        -webkit-font-smoothing: antialiased;
      }

      p {
        margin: 0 0 var(--space-m);
      }

      h1, h2, h3 {
        line-height: 1.3;
        margin-top: var(--space-l);
        margin-bottom: var(--space-s);
        font-weight: 600;
      }

      h1 { font-size: var(--h1-size); }
      h2 { font-size: var(--h2-size); }
      h3 { font-size: var(--h3-size); }

      img {
        max-width: 100%;
        height: auto;
        margin: var(--space-m) 0;
      }

      table {
        display: block;
        width: 100%;
        overflow-x: auto;
        border-collapse: collapse;
        margin: var(--space-m) 0;
      }

      td, th {
        padding: 10px 12px;
        line-height: 1.6;
      }

      pre, code {
        overflow-x: auto;
        font-size: 0.95em;
      }

      blockquote {
        margin: var(--space-m) 0;
        padding-inline-start: 1rem;
        border-inline-start: 3px solid rgba(0,0,0,0.15);
      }

      @media (min-width: 1200px) {
        body {
          max-width: 75ch;
        }
      }
    </style>
